        return <div style={{
            padding: '50px 0px 0px 370px'
        }}>
            <Sidebar/>
            <Outlet />
        </div>;
    }
    else{
        return <div style={{
            padding: '50px 0px 0px 370px'
        }}>
            <Sidebar />
            <Outlet />
        </div>;
    }
};

export default AppLayout;
